import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './App.css';
import { AppProvider } from './Context/AppContext';

ReactDOM.render(
	<React.StrictMode>
		<AppProvider>App /></AppProvider>
	</React.StrictMode>,
	document.getElementById('root')
);
